let averageWidth = 0;

if (metadata.attrs.length > Math.round((availableScreenWidth - 301) / 160)) {
  averageWidth = (availableScreenWidth - 301 - 112) / Math.round((availableScreenWidth - 301) / 160);
} else {
  averageWidth = (availableScreenWidth - 301  - 112) / metadata.attrs.length;
}

let x = 382;
let y = 258;

for (const keyAttr in metadata.attrs) {
  const element = metadata.attrs[keyAttr];

    let titleText = draw.text(nameNormalizer(element.name)).addClass('olv-title-text');

  titleText.transform({ translateX: x + averageWidth / 2 - titleText.node.clientWidth / 2, translateY: y });

  let yData = y + 72;
  let xData = x;

  let data = null;
  let txtData = null;
  for (let index = 0; index < 6; index++) {
    switch (element.type) {
      case 'guid':
      case 'number':
        txtData = Math.round(Math.random() * 1000).toString();
        data = draw.text(txtData).addClass('olv-text');
        break;
      case 'decimal':
        txtData = (Math.random() * 1000).toFixed(2).toString();
        data = draw.text(txtData).addClass('olv-text');
        break;
      case 'date':
        const date = new Date(new Date(2000, 0, 1).getTime() + Math.random() * (new Date().getTime() - new Date(2000, 0, 1).getTime()));

        let month = (date.getMonth() + 1).toString();
        let day = date.getDate().toString();
        let year = date.getFullYear();

        if (month.length < 2) {
          month = '0' + month;
        }
        if (day.length < 2) {
          day = '0' + day;
        }

        txtData = [day, month, year].join('.');
        data = draw.text(txtData).addClass('olv-text');
        break;
      case 'boolean':
        draw.svg(`
        <rect x="${x + averageWidth / 2 - 24 / 2}" y="${yData}" width="23" height="23" rx="4.5" fill="#ECF2FB"/>
        <rect x="${x + averageWidth / 2 - 24 / 2}" y="${yData}" width="23" height="23" rx="4.5" stroke="#848E99"/>
        `);
        break;
      case 'file':
        data = draw.text('file.xlsx').addClass('olv-text');
        break;
      case 'string':
      default:
        data = draw.text('Data text').addClass('olv-text');
    }

    if (element.type != 'boolean') {
      xData = x + averageWidth / 2 - data.node.clientWidth / 2;
      data.transform({ translateX: xData, translateY: yData });
    }
    yData += 72;
  }

  x += averageWidth;

  if (9 == keyAttr) {
    break;
  }
}
